B.aiF=new A.hl("2. Information We Collect","Wallet Address: When you connect your Solana wallet, we collect your public wallet address. This is required to facilitate deposits, match settlements, and withdrawals.\n\nOn-Chain Transaction Data: All match bets, settlements, and transfers are recorded on the Solana blockchain and are publicly visible.\n\nUsage Data: We collect anonymized usage analytics including pages visited, match history, features used, device type, browser type, and approximate geographic region.\n\nCommunications: If you contact us via email, Discord, or the feedback form, we retain the content of those communications to provide support.")
B.aif=new A.hl("3. Information We Do NOT Collect","We do not collect your real name, email address (unless you voluntarily provide it), phone number, government-issued ID, or any other personally identifiable information (PII). SolFight is designed to operate with wallet-based authentication only.")
